import { StyleSheet } from "react-native";
import { ScaledSheet } from "react-native-size-matters";

const hamburgerStyles = StyleSheet.create({
  menuIcon: {
    zIndex: 9,
    left: 20,
  },
});

module.exports = hamburgerStyles;
